import styled from "styled-components";


export const LoginFormWrapper = styled.form`
    margin-top: 5px;
    margin-left: 6px;
    padding-top: 4px;
    padding-left: 8px;
    padding-right: 8px;
    padding-bottom: 10px;
    border: 1px solid skyblue;
    border-radius: 5px;

`
  
export const LoginButtonWrapper = styled.div`
    margin-top: 10px;
    display:flex;
    justify-content:space-around;
`;
